import React, { useEffect } from 'react';
import { Link } from 'react-router-dom';
import styles from './RightCont.module.css'
import WOW from 'wowjs'

function RightCont() {
  useEffect(() => {
    new WOW.WOW().init();
  },[])
  return (
    <>
      <div className={styles.rightCont}>
        <div className={`${styles.mainAlbumName} wow fadeInRight`} data-wow-delay='0.1s' data-wow-duration='2s'>
          <Link style="font-family: 'Spoqa Han Sans Neo', 'sans-serif'">READY TO BE</Link>
        </div>
        <div className={styles.mainAlbumSong}>
          <Link>SET ME FREE</Link>
        </div>
        <div className={styles.mainLine}></div>
        <div>
          <div className={styles.maintt}>NOTICE</div>
          <div className={styles.mainstt}>
            Beyond LIVE - TWICE 5TH WORLD TOUR ‘READY TO BE’ in JAPAN  티켓 오픈!
          </div>
        </div>
      </div>
    </>
  );
}

export default RightCont;
